import { Box, Button,  Grid, TextField, Typography } from '@mui/material'
import { styled } from "@mui/material/styles";
import React from 'react'




// Custom TextField

const CTextField = styled(TextField)({
  '& .MuiInputBase-input': {

    position: 'relative',
    fontSize: 20,
    padding: '12px',

  },
  "& label.Mui-focused": {
    color: "#9B3C21"
  },

  "& .MuiOutlinedInput-root": {
    "& fieldset": {
      border: "2px solid #000000",
    },
    "&.Mui-focused fieldset": {

      border: "2px solid #9B3C21"
    }
  }
});


const Add_item = () => {
  return (
    <div>


      {/* WHOLE CONTAINER LOADS */}
      <Grid container spacing={2} style={{
        border:'2px solid red'
      }}>


        {/* Add Item */}
        <Grid containe marginTop={10} marginLeft={10}>
          <Typography variant='h3'> Add new item</Typography>
        </Grid>

        {/* container inputs */}
        <Grid
          container
          direction="row"
          justifyContent="center"
          alignItems="center">

{/* isa pang container para maayos ang margin */}
          <Grid
          container

          marginY={2}
          marginLeft={5}
          marginRight={2}
          direction="row"
          justifyContent="center"
          alignItems="center"
          style={
            {
              border: '2px solid black',
              backgroundColor: 'white'
            }
          }
          >
      
            <Grid item md= {11} margin={2} >
              <CTextField fullWidth  label="Product name" variant="outlined" margin="normal"/>
           
              <CTextField fullWidth label="Product Category" variant="outlined" margin="normal" />
          
              <CTextField fullWidth label="Product name" variant="outlined"  margin="normal" />
          
              <CTextField fullWidth label="Product name" variant="outlined"  margin="normal"/>
            </Grid>
            
     

          </Grid>

          <Button 
          variant='contained'  
          style={{
            borderRadius: '10px',
            width:200,
            marginBottom:10,
            padding:10
          }}> create </Button>

            <Button variant='contained'  style={{
            borderRadius: '10px',
            width:200,
            marginBottom:10,
            padding:10
          }}> cancel </Button>

        </Grid>

        













      </Grid>
      
    </div>
  )
}

export default Add_item
